  ngOnInit(): void {
    if (!this.navigationPages) {
      this.navigationPages = NAVIGATION_LINKS;
    }
  }

  public onNavClick(index: number) {
    this.navigationPages.forEach((x,i) => {
      x.isActive = i === index;
    });
  }
}

